static char *
rv_restore(const char * const var, const void * const data)
{
	if (strcmp(var, "RMF") == 0) {
                // Restore mouse fields...
		kill_mouse_fields();
		copy_mouse_fields(rip.saved_mfields, &rip.mfields);
		return NULL;
	}
	if (strcmp(var, "RTW") == 0) {
		if (rip.stw.sx == 0 && rip.stw.sy == 0 && rip.stw.ex == 0 && rip.stw.ey == 0) {
			rip.text_disabled = true;
		}
		else {
			rip.text_disabled = false;
		}
		rip_text_window(rip.stw.sx, rip.stw.sy, rip.stw.ex, rip.stw.ey, rip.stw.wrap, rip.stw.size);
		rip.x = rip.stw.x;
		rip.y = rip.stw.y;
		rip.curstype = rip.stw.curstype;
		_setcursortype(rip.curstype);
		cterm->attr = rip.stw.attr;
		attr2palette(cterm->attr, &cterm->fg_color, &cterm->bg_color);
		return NULL;
	}
	if (strcmp(var, "RCB") == 0) {
		rip.clipx = rip.scb.x;
		rip.clipy = rip.scb.y;
		freepixels(rip.clipboard);
		rip.clipboard = duppixels(rip.scb.pix);
		return NULL;
	}
	printf("TODO: Restore RIP Variables (%s)\n", var);
	return NULL;
}

static int
unmap_rip_x(int x)
{
	int i;

	if (rip.xunmap == NULL) {
		rip.xunmap = malloc(rip.x_dim * sizeof(int));
		if (rip.xunmap == NULL) {
			double dx = x;

			dx *= rip.x_max;
			dx /= rip.x_dim;
			return roundl(dx);
		}
		for (i = 0; i < rip.x_dim; i++)
			rip.xunmap[i] = roundl(((double)i) * rip.x_dim / rip.x_max);
	}
	if (x >= rip.x_dim)
		x = rip.x_dim - 1;
	return rip.xunmap[x];
}

static int
unmap_rip_y(int y)
{
	int i;

	if (rip.yunmap == NULL) {
		rip.yunmap = malloc(rip.y_dim * sizeof(int));
		if (rip.yunmap == NULL) {
			double dy = y;

			dy *= rip.y_max;
			dy /= rip.y_dim;
			return roundl(dy);
		}
		for (i = 0; i < rip.y_dim; i++)
			rip.yunmap[i] = roundl(((double)i) * rip.y_dim / rip.y_max);
	}
	if (y >= rip.y_dim)
		y = rip.y_dim - 1;
	return rip.yunmap[y];
}

static int
map_rip_x(int x)
{
	int i;

	if ((x < 0) || (x >= rip.x_dim)) {
		double dx = x;

		dx *= rip.x_max;
		dx /= rip.x_dim;
		return roundl(dx);
	}

	if (rip.xmap == NULL) {
		rip.xmap = malloc(rip.x_dim * sizeof(int));
		if (rip.xmap == NULL) {
			double dx = x;

			dx *= rip.x_max;
			dx /= rip.x_dim;
			return roundl(dx);
		}
		for (i = 0; i < rip.x_dim; i++) {
			rip.xmap[i] = roundl(((double)i) * rip.x_max / rip.x_dim);
			if (rip.xmap[i] >= rip.x_max)
				rip.xmap[i] = rip.x_max - 1;
		}
	}
	if (x >= rip.x_dim)
		x = rip.x_dim;
	return rip.xmap[x];
}

static int
map_rip_y(int y)
{
	int i;

	if ((y < 0) || (y >= rip.y_dim)) {
		double dy = y;

		dy *= rip.y_max;
		dy /= rip.y_dim;
		return roundl(dy);
	}

	if (rip.ymap == NULL) {
		rip.ymap = malloc(rip.y_dim * sizeof(int));
		if (rip.ymap == NULL) {
			double dy = y;

			dy *= rip.y_max;
			dy /= rip.y_dim;
			return roundl(dy);
		}
		for (i = 0; i < rip.y_dim; i++) {
			rip.ymap[i] = roundl(((double)i) * rip.y_max / rip.y_dim);
			if (rip.ymap[i] >= rip.y_max)
				rip.ymap[i] = rip.y_max - 1;
		}
	}
	if (y >= rip.y_dim)
		y = rip.y_dim;
	return rip.ymap[y];
}

