static char *
rv_erase(const char * const var, const void * const data)
{
	int x, y;

	switch (var[1]) {
		case 'G':
			if (no_viewport())
				return NULL;
			for (y = rip.viewport.sy; y <= rip.viewport.ey; y++) {
				for (x = rip.viewport.sx; x <= rip.viewport.ex; x++)
					rip_setpixel(x, y, 0);
			}
			return NULL;
		case 'T':
			cterm_clearscreen(cterm, cterm->attr);
			cterm_gotoxy(cterm, 1, 1);
			return NULL;
	}
	printf("TODO: RIP Variables (%s)\n", var);
	return NULL;
}

