static char *
rv_termset(const char * const var, const void * const data)
{
	struct text_info ti;
	char             str[128];

	switch (var[0]) {
		case 'C':
			switch (var[1]) {
				case 'O':
					switch (var[2]) {
						case 'F':
							rip.curstype = _NOCURSOR;
							_setcursortype(rip.curstype);
							return NULL;
						case 'N':
							rip.curstype = _NORMALCURSOR;
							_setcursortype(rip.curstype);
							return NULL;
						case 'M':
							rip.x_dim = 640;
							rip.y_dim = 350;
							assert_rwlock_rdlock(&vstatlock);
							rip.x_max = vstat.scrnwidth;
							rip.y_max = vstat.scrnheight;
							assert_rwlock_unlock(&vstatlock);
							if (rip.x_max > rip.x_dim)
								rip.x_max = rip.x_dim;
							if (rip.y_max > rip.y_dim)
								rip.y_max = rip.y_dim;

                                                        // TODO: Hack... we should likely scale both directions...
							rip.viewport.sx = 0;
							rip.viewport.sy = 0;
							rip.viewport.ex = rip.x_dim - 1;
							rip.viewport.ey = rip.y_dim - 1;
							FREE_AND_NULL(rip.xmap);
							FREE_AND_NULL(rip.ymap);
							FREE_AND_NULL(rip.xunmap);
							FREE_AND_NULL(rip.yunmap);
							return NULL;
					}
					break;
				case 'U':
					switch (var[3]) {
						case 'S':
							if ((cterm->left_margin == 1) && (cterm->right_margin == 1)
							    && (cterm->top_margin == 1) && (cterm->bottom_margin == 1))
								return strdup("NO");
							if (rip.text_disabled)
								return strdup("NO");
							if (rip.curstype == _NOCURSOR)
								return strdup("NO");
							return strdup("YES");
						case 'X':
							gettextinfo(&ti);
							snprintf(str, sizeof(str), "%d", ti.curx - 1);
							return strdup(str);
						case 'Y':
							gettextinfo(&ti);
							snprintf(str, sizeof(str), "%d", ti.cury - 1);
							return strdup(str);
					}
					break;
			}
			break;
		case 'D':
			switch (var[5]) {
				case 'F':
					cterm->doorway_mode = false;
					return NULL;
				case 'N':
					cterm->doorway_mode = true;
					return NULL;
			}
			break;
		case 'S': {
			void *font;
			int   width;
			int   height;

			assert_rwlock_rdlock(&vstatlock);
			font = vstat.forced_font;
			width = vstat.charwidth;
			height = vstat.charheight;
			assert_rwlock_unlock(&vstatlock);
			switch (var[5]) {
				case 'F':
					gettextinfo(&ti);
					term.nostatus = true;
					reinit_screen(font, width, height);
					return NULL;
				case 'N':
					gettextinfo(&ti);
					term.nostatus = false;
					reinit_screen(font, width, height);
					return NULL;
			}
			break;
		}
		case 'V':
			switch (var[6]) {
				case 'F':
				case 'N':
					break;

                                        // TODO: This is total crap...
			}
			break;
	}
	printf("TODO: rv_termset(%s)\n", var);
	return NULL;
}

