static int
parse_mega(const char *buf, int fieldwidth)
{
	int i;
	int ret = 0;

        // TODO: Apparently, the last option can always be shortened...
        // TODO: Do we need to pass this info back?
	for (i = 0; i < fieldwidth; i++) {
		ret *= 36;
		if ((buf[i] >= '0') && (buf[i] <= '9')) {
			ret += (buf[i] - '0');
		}
		else if ((buf[i] >= 'A') && (buf[i] <= 'Z')) {
			ret += (buf[i] - 'A' + 10);
		}
		else if ((buf[i] >= 'a') && (buf[i] <= 'z')) {
			ret += (buf[i] - 'a' + 10);
		}
		else {
			if (i == 0)
				return -1;
			ret /= 36;
			return ret;
		}
	}
	return ret;
}

static char *
parse_string(const char *buf)
{
	size_t inpos = 0;
	char  *p;
	int    ch;
	char  *ret = malloc(strlen(buf) + 1);

	if (ret == NULL)
		return ret;
	for (p = ret; (ch = next_char(buf, &inpos)) > 0; inpos++)
		*(p++) = ch;
	*p = 0;
	return ret;
}

static void
buffer_rip(const BYTE *buf, unsigned len)
{
	size_t new_size;
	char  *p;

	if (pending_len + len + 1 > pending_size) {
		new_size = pending_size ? pending_size * 2 : 1024;
		if (new_size < pending_len + len + 1)
			new_size = pending_len + len + 1;
		p = realloc(pending, new_size);

                // TODO: Can we handle this gracefully?
		if (p == NULL)
			return;
		pending = p;
		pending_size = new_size;
	}
	memcpy(&pending[pending_len], buf, len);
	pending_len += len;
	pending[pending_len] = 0;
}

static void
buffer_data(const BYTE *buf, unsigned len)
{
	size_t new_size;
	BYTE  *p;

	if (moredata_len + len + 1 > moredata_size) {
		new_size = moredata_size ? moredata_size * 2 : 1024;
		if (new_size < moredata_len + len + 1)
			new_size = moredata_len + len + 1;
		p = realloc(moredata, new_size);

                // TODO: Can we handle this gracefully?
		if (p == NULL)
			return;
		moredata = p;
		moredata_size = new_size;
	}
	memcpy(&moredata[moredata_len], buf, len);
	moredata_len += len;
	moredata[moredata_len] = 0;
}

static int
next_char(const char *buf, size_t *pos)
{
	while (buf[*pos] == '\\') {
		(*pos)++;
		if (buf[*pos] == '\r') {
			(*pos)++;
			if (buf[*pos] == '\n')
				(*pos)++;
		}
		else if (buf[*pos] == '\n') {
			(*pos)++;
		}
		else {
			return (uint8_t)buf[*pos];
		}
	}

        /*if (buf[*pos] == '!')
         *       return -1;
         *  else */
	if (buf[*pos] == '|')
		return -1;
	else if (buf[*pos] == '\r')
		return -1;
	else if (buf[*pos] == '\n')
		return -1;
	return (uint8_t)buf[*pos];
}

