static uint32_t
pixel2color(uint32_t pix)
{
	int i;
	pix &= 0x80FFFFFF;

	for (i = 0; i < 16; i++) {
		if (ega_colours[i] == pix)
			break;
	}
	if (i == 16) {
		for (i = 0; i < 256; i++) {
			if (map_rip_color(i) == pix)
				break;
		}
		if (i == 256)
			printf("TODO: Unable to convert color %08" PRIx32 " to palette color\n", pix);
		return 0;
	}
	return i;
}

static void
draw_pixel(int x, int y)
{
	struct ciolib_pixels *pix;

	if ((x < 0) || (x > (rip.viewport.ex - rip.viewport.sx)))
		return;
	if ((y < 0) || (y > (rip.viewport.ey - rip.viewport.sy)))
		return;
	if (rip.xor) {
		pix = getpixels(rip.viewport.sx + x, rip.viewport.sy + y, rip.viewport.sx + x, rip.viewport.sy + y, 0);
		if (pix == NULL)
			return;
		if (pix->pixels[0] & 0x40000000) {
			return;
			freepixels(pix);
		}
		rip_setpixel(rip.viewport.sx + x, rip.viewport.sy + y, pixel2color(pix->pixels[0]) ^ rip.color);
		freepixels(pix);
		pix = getpixels(rip.viewport.sx + x, rip.viewport.sy + y, rip.viewport.sx + x, rip.viewport.sy + y, 0);
		if (pix) {
			pix->pixels[0] |= 0x40000000;
			setpixels(rip.viewport.sx + x, rip.viewport.sy + y, rip.viewport.sx + x, rip.viewport.sy + y, 0, 0, 0, 0, pix, NULL);
			freepixels(pix);
		}
	}
	else {
		rip_setpixel(rip.viewport.sx + x, rip.viewport.sy + y, rip.color);
	}
}

// TODO: Should should only be used by things that use the write mode.
static void
set_pixel(int x, int y, uint32_t fg)
{
	if ((x < 0) || (x > (rip.viewport.ex - rip.viewport.sx)))
		return;
	if ((y < 0) || (y > (rip.viewport.ey - rip.viewport.sy)))
		return;
	scale_setpixel(rip.viewport.sx + x, rip.viewport.sy + y, fg);
}

static void
native_fill_pixel(int x, int y)
{
	if (rip.fill_pattern[y & 0x07] & (0x80 >> (x & 0x07)))
		setpixel(x, y, map_rip_color(rip.fill_color));
	else
		setpixel(x, y, map_rip_color(0));
}

static void
fill_pixel(int x, int y)
{
	x += rip.viewport.sx;
	y += rip.viewport.sy;
	if ((x > rip.viewport.ex) || (y > rip.viewport.ey))
		return;

        // Handle the translation here for nicer fills...
	x = map_rip_x(x);
	y = map_rip_y(y);
	native_fill_pixel(x, y);
}

static int
char_width_raw(char ch)
{
	int           chnum;
	int           fchar;
	int           nchars;
	unsigned char uch = ch;

	if (rip.font.num == 0) {
		return 8;
	}
	else {
		fchar = rip_fonts[rip.font.num - 1][0x84];
		if (uch < fchar)
			return 0;
		chnum = uch - rip_fonts[rip.font.num - 1][0x84];
		nchars = *((uint16_t *)&rip_fonts[rip.font.num - 1][0x81]);
		if (uch - fchar >= nchars)
			return 0;
		return rip_fonts[rip.font.num - 1][0x90 + nchars * 2 + chnum];
	}
}

static int
char_width(char ch)
{
	int mult;
	int div;

	if (rip.font.num == 0) {
		return 8 * rip.font.size;
	}
	else {
		mult = stroke_mults[rip.font.size];
		div = stroke_divs[rip.font.size];
		return char_width_raw(ch) * mult / div;
	}
}

static void
char_top_base(char ch, int *top, int *bottom)
{
	int      fontoffset;
	uint8_t *this_font;
	int      y;

	if (rip.font.num == 0) {
		this_font = (uint8_t *)conio_fontdata[0].eight_by_eight;
		fontoffset = ('A') * 8;
		*top = -1;
		*bottom = -1;
		for (y = 0; y < 8; y++) {
			if (this_font[fontoffset]) {
				if (*top == -1)
					*top = y * rip.font.size;
				*bottom = y * rip.font.size;
			}
			fontoffset++;
		}
	}
	else {
		*top = (int)font_metrics[rip.font.num][rip.font.size - 1].top;
		*bottom = (int)font_metrics[rip.font.num][rip.font.size - 1].base;
	}
}

static void
char_top_bottom(char ch, int *top, int *bottom)
{
	int      fontoffset;
	uint8_t *this_font;
	int      y;

	if (rip.font.num == 0) {
		this_font = (uint8_t *)conio_fontdata[0].eight_by_eight;
		fontoffset = ((uint8_t)ch) * 8;
		*top = -1;
		*bottom = -1;
		for (y = 0; y < 8; y++) {
			if (this_font[fontoffset]) {
				if (*top == -1)
					*top = y * rip.font.size;
				*bottom = y * rip.font.size;
			}
			fontoffset++;
		}
	}
	else {
		if (low_char[(uint8_t)ch]) {
			*top = (int)font_metrics[rip.font.num][rip.font.size - 1].top;
			*bottom = (int)font_metrics[rip.font.num][rip.font.size - 1].drop;
		}
		else {
			*top = (int)font_metrics[rip.font.num][rip.font.size - 1].top;
			*bottom = (int)font_metrics[rip.font.num][rip.font.size - 1].base;
		}
	}
}

static int
font_height()
{
	int mult = stroke_mults[rip.font.size];
	int div = stroke_divs[rip.font.size];

	if (rip.font.num == 0)
		return 8 * rip.font.size;
	return (((char)rip_fonts[rip.font.num - 1][0x88]) - ((char)rip_fonts[rip.font.num - 1][0x8a])) * mult / div;
}

static void
write_char(char ch)
{
	int           x, xs;
	int           y, ys;
	int           fontoffset;
	uint8_t      *this_font;
	int           chnum;
	int           fchar;
	int           nchars;
	char          cx;
	char          cy;
	int           oc;
	int           yh;
	int           mult;
	int           div;
	int           bcx, bcy;
	int           dx, dy;
	int           orig_width = rip.line_width;
	uint16_t      orig_pattern = rip.line_pattern;
	unsigned char uch = ch;

	if (no_viewport())
		return;

	if (rip.font.num == 0) {
                // NOTE: Bitmap fonts don't work vertically for no apparent reason.
		if (rip.font.vertical)
			return;

                // Bitmap 8x8 font
		this_font = (uint8_t *)conio_fontdata[0].eight_by_eight;
		fontoffset = (uch) * 8;

		for (y = 0; y < 8; y++) {
			for (x = 0; x < 8; x++) {
				for (ys = 0; ys < rip.font.size; ys++) {
					for (xs = 0; xs < rip.font.size; xs++) {
						if (this_font[fontoffset] & (0x80 >> x)) {
                                                        // NOTE: Bitmap fonts don't use write mode...
                                                        // draw_pixel(rip.x + (x * rip.font.size) + xs, rip.y + (y *
                                                        // rip.font.size)+ ys);
							set_pixel(rip.x + (x * rip.font.size) + xs,
							    rip.y + (y * rip.font.size) + ys, map_rip_color(rip.color));
						}
					}
				}
			}
			fontoffset++;
		}
		if (rip.font.vertical)
			rip.y += 8 * rip.font.size;
		else
			rip.x += 8 * rip.font.size;
	}
	else {
		xs = rip.x;
		ys = rip.y;
		fchar = rip_fonts[rip.font.num - 1][0x84];
		if (uch < fchar)
			return;
		chnum = uch - fchar;
		nchars = *(uint16_t *)(&rip_fonts[rip.font.num - 1][0x81]);
		if (chnum >= nchars)
			return;
		fontoffset = 0x80 + *((uint16_t *)(&rip_fonts[rip.font.num - 1][0x85]));
		fontoffset += *((uint16_t *)(&rip_fonts[rip.font.num - 1][0x90 + chnum * 2]));
		mult = stroke_mults[rip.font.size];
		div = stroke_divs[rip.font.size];

                // Doing it this way makes it too big on triplex 3
                // yh = rip_fonts[rip.font.num - 1][0x88] - 1;
                // yh *= mult;
                // yh /= div;
                // yh += font_metrics[rip.font.num][rip.font.size - 1].top;

                // Doing it this way is broken on little 7 (bad table entry)
                // yh = font_metrics[rip.font.num][rip.font.size - 1].base;

                // Doing it this way is too high on bold 1
                // yh = font_metrics[rip.font.num][3].base * mult / div;

                // This way seems insane... but seems to work.
		yh = (((signed char)rip_fonts[rip.font.num - 1][0x88]) - ((signed char)rip_fonts[rip.font.num - 1][0x8a])) * mult
		    / div;

// printf("Font: %d @ %d\n", rip.font.num, rip.font.size);
// printf("ott: %hhd, otb: %hhd, otbd: %hhd, mult: %d, div: %d, yh: %d\n", rip_fonts[rip.font.num - 1][0x88],
// rip_fonts[rip.font.num - 1][0x89], rip_fonts[rip.font.num - 1][0x8a], mult, div, yh);
// printf("top: %d, bow: %d, base: %d, drop: %d\n", font_metrics[rip.font.num][rip.font.size - 1].top,
// font_metrics[rip.font.num][rip.font.size - 1].bow, font_metrics[rip.font.num][rip.font.size - 1].base,
// font_metrics[rip.font.num][rip.font.size - 1].drop);
// printf("3top: %d, 3bow: %d, 3base: %d, 3drop: %d\n", font_metrics[rip.font.num][3].top,
// font_metrics[rip.font.num][3].bow, font_metrics[rip.font.num][3].base, font_metrics[rip.font.num][3].drop);

		rip.line_width = 1;
		rip.line_pattern = 0xffff;
		oc = 1;
		while (oc != 0) {
			cx = rip_fonts[rip.font.num - 1][fontoffset++];
			cy = rip_fonts[rip.font.num - 1][fontoffset++];
			oc = (cx >> 6) & 0x02;
			oc |= (cy >> 7) & 0x01;
			cx &= 0x7F;
			cy &= 0x7F;
			if (cx & 0x40)
				cx |= 0x80;
			if (cy & 0x40)
				cy |= 0x80;
			bcx = ((signed char)cx * mult) / div;
			bcy = ((signed char)cy * mult) / div;
			if (rip.font.vertical) {
				dx = yh - bcy;
				dy = -bcx;
			}
			else {
				dx = bcx;
				dy = yh - bcy;
			}
			switch (oc) {
				case 0:
                                        // Done!
					break;
				case 1:
					puts("TODO: \"Do scan\"\n");
					break;
				case 3:
					draw_line(rip.x, rip.y, xs + dx, ys + dy, true);

                                // Fall-through...
				case 2:
					rip.x = xs + dx;
					rip.y = ys + dy;
					break;
			}
		}
		if (rip.font.vertical) {
			rip.y = ys;
			rip.x = xs + yh;
		}
		else {
			rip.y = ys;
			rip.x = xs + char_width(ch);
		}
		rip.line_width = orig_width;
		rip.line_pattern = orig_pattern;
	}
}

static void
write_text(const char *str)
{
	const char *p;

	if (str == NULL)
		return;
	if (rip.font.vertical) {
		int sx = rip.x;
		int sy = rip.y;
		int cy;
		int tw = 0;

                // Yes, this is actually a thing.
		for (p = str; *p; p++)
			tw += char_width_raw(*p);
		tw *= stroke_mults[rip.font.size];
		tw /= stroke_divs[rip.font.size];

		rip.y += tw;
		cy = rip.y;
		for (p = str; *p; p++) {
			rip.x = sx;
			rip.y = cy;
			write_char(*p);
			cy -= char_width(*p);
		}
		rip.y = sy;
		rip.x = sx + tw;
	}
	else {
		for (p = str; *p; p++)
			write_char(*p);
	}
}

static void
draw_line(int x1, int y1, int x2, int y2, bool final)
{
	int *minc, *mins, *mino, *mind;
	int *maxc, *maxs, *maxe, *maxo, *maxd;
	int  x, y;
	int  swap = 0;
	int  dx = abs(x2 - x1);
	int  dy = abs(y2 - y1);

        // Swap endpoints
	if (y2 < y1)
		swap = 1;

	if (swap) {
		x = x2;
		y = y2;
		x2 = x1;
		y2 = y1;
		x1 = x;
		y1 = y;
	}

	int xoff;

	if (x2 < x1)
		xoff = -1;
	else
		xoff = 1;

	int yoff;

	if (y2 < y1)
		yoff = -1;
	else
		yoff = 1;

	if (dx >= dy) {
		minc = &y;
		mins = &y1;
		mino = &yoff;
		mind = &dy;

		maxc = &x;
		maxs = &x1;
		maxe = &x2;
		maxo = &xoff;
		maxd = &dx;
	}
	else {
		minc = &x;
		mins = &x1;
		mino = &xoff;
		mind = &dx;

		maxc = &y;
		maxs = &y1;
		maxe = &y2;
		maxo = &yoff;
		maxd = &dy;
	}

	int de = 2 * *mind - *maxd;
	int ppos = 0;

	if (no_viewport())
		return;

	*minc = *mins;

	for ((*maxc) = *maxs; (((*maxs) < (*maxe)) ? ((*maxc) <= (*maxe)) : ((*maxc) >= (*maxe))); (*maxc) += *maxo) {
		if (rip.line_pattern & (0x8000 >> ppos))
			draw_pixel(x, y);
		if (de >= 0) {
			*minc = (*minc) + *mino;
			de = de - ((2 * *maxd) & INT_MAX);
		}
		de = de + ((2 * *mind) & INT_MAX);
		ppos++;
		if (ppos == 16)
			ppos = 0;
		if (*maxs == *maxe)
			break;
	}
	if (rip.line_width == 3) {
		rip.line_width = 1;

                // Figure out start/end points based on first movement...
		de = 2 * *mind - *maxd;

// if (de >= 0) {
                // L-shape...
// draw_line(x1 + xoff, y1, x2 + xoff, y2);
// draw_line(x1, y1 + yoff, x2, y2 + yoff);
// }
// else {
                // I-shape...
		if (dx >= dy) {
			draw_line(x1, y1 + 1, x2, y2 + 1, false);
			draw_line(x1, y1 - 1, x2, y2 - 1, false);
		}
		else {
			draw_line(x1 + 1, y1, x2 + 1, y2, false);
			draw_line(x1 - 1, y1, x2 - 1, y2, false);
		}

// }
		rip.line_width = 3;
	}

	if (final && rip.xor) {
		struct ciolib_pixels *pix = getpixels(0, 0, rip.x_max - 1, rip.y_max - 1, false);
		if (pix) {
			size_t off = 0;
			for (y = 0; y < pix->height; y++) {
				for (x = 0; x < pix->width; x++)
					pix->pixels[off++] &= ~0x40000000;
			}
			setpixels(0, 0, rip.x_max - 1, rip.y_max - 1, 0, 0, 0, 0, pix, NULL);
			freepixels(pix);
		}
	}
}

