void
chisel_inset(int height, int *xinset, int *yinset)
{
	if (height < 12) {
		*xinset = 1;
		*yinset = 1;
		return;
	}
	if (height < 25) {
		*xinset = 3;
		*yinset = 2;
		return;
	}
	if (height < 40) {
		*xinset = 4;
		*yinset = 3;
		return;
	}
	if (height < 75) {
		*xinset = 6;
		*yinset = 5;
		return;
	}
	if (height < 150) {
		*xinset = 7;
		*yinset = 5;
		return;
	}
	if (height < 200) {
		*xinset = 8;
		*yinset = 6;
		return;
	}
	if (height < 250) {
		*xinset = 10;
		*yinset = 7;
		return;
	}
	if (height < 300) {
		*xinset = 11;
		*yinset = 8;
		return;
	}
	*xinset = 13;
	*yinset = 9;
}

static void
invert_rect(int x1, int y1, int x2, int y2)
{
	uint32_t              palette[16];
	struct ciolib_pixels *pix;
	uint32_t              col;
	size_t                pixel;
	int                   x, y, i;
	struct text_info      ti;

	gettextinfo(&ti);
	get_modepalette(palette);
	pix = getpixels(x1, y1, x2, y2, false);
	if (pix == NULL)
		return;

	pixel = 0;
	for (y = 0; y < pix->height; y++) {
		for (x = 0; x < pix->width; x++) {
			col = pix->pixels[pixel] & 0x80FFFFFF;
			for (i = 0; i < 16; i++) {
				if (col == palette[i])
					break;
			}
			if (i < 16) {
				i ^= 0x0f;
				pix->pixels[pixel] = palette[i];
			}

			col = pix->pixelsb[pixel] & 0x80FFFFFF;
			for (i = 0; i < 16; i++) {
				if (col == palette[i])
					break;
			}
			if (i < 16) {
				i ^= 0x0f;
				pix->pixelsb[pixel] = palette[i];
			}

			pixel++;
		}
	}
	setpixels(x1, y1, x2, y2, 0, 0, 0, 0, pix, NULL);
	freepixels(pix);
}

/*
 * TODO: This is slow and still broken.  While it's fine for the
 *       pie slices because of their inherent simplicity, it's
 *       not at all good for the poly bezier.  The root of the
 *       problem is really detecting line crossings given just
 *       the raster data.  With the poly line, it's not as hard
 *       since the extents of the lines are known and are fairly
 *       simple to calculate... which is not true for beziers.
 *
 * How this works is it advances looking for line edges, when it
 * reaches the first non-edge pixel after an edge pixel, it toggles
 * the fill boolean, and marks the pixels with a bit in the high
 * byte of the colour.  It does this in four different directions,
 * and any point that was hit by all four directions is filled.
 * Finally, any non-border pixel that touches a filled pixel
 * horizontally or vertically is also filled.
 *
 * TODO: The various loops could all be combined to run all passes
 *       at the same time.  The X and Y loop variables aren't
 *       actually used in the the loops.
 */
static void
do_fill(bool overwrite)
{
	struct ciolib_pixels *pix;
	int                   x, y;
	int                   pixel;
	bool                  fill = false;
	bool                  in_line = false;

	pix = getpixels(0, 0, rip.x_max - 1, rip.y_max - 1, false);
	if (pix == NULL)
		return;
	FREE_AND_NULL(pix->pixelsb);

        // Horizontal even-odd top-left to bottom-right.
	pixel = 0;
	for (y = 0; y < pix->height; y++) {
		in_line = fill = false;
		for (x = 0; x < pix->width; x++) {
			if (in_line) {
				if (!(pix->pixels[pixel] & 0x40000000)) {
					fill = !fill;
					in_line = false;
				}
			}
			else {
				if (pix->pixels[pixel] & 0x40000000)
					in_line = true;
			}
			if (fill & !in_line)
				pix->pixels[pixel] |= 0x20000000;
			pixel++;
		}
	}

        // Horizontal even-odd bottom-right to top-left
	pixel = pix->height * pix->width - 1;
	for (y = 0; y < pix->height; y++) {
		in_line = fill = false;
		for (x = 0; x < pix->width; x++) {
			if (in_line) {
				if (!(pix->pixels[pixel] & 0x40000000)) {
					fill = !fill;
					in_line = false;
				}
			}
			else {
				if (pix->pixels[pixel] & 0x40000000)
					in_line = true;
			}
			if (fill & !in_line)
				pix->pixels[pixel] |= 0x10000000;
			pixel--;
		}
	}

        // Vertical even-odd top-left to bottom-right.
	for (x = 0; x < pix->width; x++) {
		pixel = x;
		in_line = fill = false;
		for (y = 0; y < pix->height; y++) {
			if (in_line) {
				if (!(pix->pixels[pixel] & 0x40000000)) {
					fill = !fill;
					in_line = false;
				}
			}
			else {
				if (pix->pixels[pixel] & 0x40000000)
					in_line = true;
			}
			if (fill & !in_line)
				pix->pixels[pixel] |= 0x08000000;
			pixel += pix->width;
		}
	}

        // Vertical even-odd bottom-right to top-left
	for (x = 0; x < pix->width; x++) {
		pixel = (pix->height * pix->width) - x - 1;
		in_line = fill = false;
		for (y = 0; y < pix->height; y++) {
			if (in_line) {
				if (!(pix->pixels[pixel] & 0x40000000)) {
					fill = !fill;
					in_line = false;
				}
			}
			else {
				if (pix->pixels[pixel] & 0x40000000)
					in_line = true;
			}
			if (fill & !in_line)
				pix->pixels[pixel] |= 0x04000000;
			pixel -= pix->width;
		}
	}

        // Horizontal gap-fill
	pixel = 0;
	for (y = 0; y < pix->height; y++) {
		pixel++;
		for (x = 1; x < pix->width - 1; x++) {
			int filled = pix->pixels[pixel] & 0x3c000000;

			if (filled && (filled != 0x3c000000)) {
				if (((pix->pixels[pixel - 1] & 0xff000000) == 0x3c000000)
				    || ((pix->pixels[pixel + 1] & 0xff000000) == 0x3c000000))
					pix->pixels[pixel] |= 0x3c000000;
			}
			pixel++;
		}
		pixel++;
	}

        // Vertical gap-fill
	for (x = 0; x < pix->width; x++) {
		pixel = x;
		pixel += pix->width;
		for (y = 1; y < pix->height - 1; y++) {
			int filled = pix->pixels[pixel] & 0x3c000000;

			if (filled && (filled != 0x3c000000)) {
				if (((pix->pixels[pixel - pix->width] & 0xff000000) == 0x3c000000)
				    || ((pix->pixels[pixel + pix->width] & 0xff000000) == 0x3c000000))
					pix->pixels[pixel] |= 0x3c000000;
			}
			pixel += pix->width;
		}
		pixel += pix->width;
	}

        // Update the screen
	pixel = 0;
	for (y = 0; y < pix->height; y++) {
		for (x = 0; x < pix->width; x++) {
			switch ((pix->pixels[pixel] >> 26) & 0x1f) {
				case 0:
					break;
				case 15:
					native_fill_pixel(x, y);
					break;
				case 16:
					setpixel(x, y, pix->pixels[pixel] & 0x80ffffff);
					break;
			}
			pixel++;
		}
	}
	freepixels(pix);
}

